import React from 'react';
import Layout from '../components/Layout';

const Home = () => {
    return (
        <Layout>
            <div className="container mt-4">
                <h1>Welcome to Story Writer</h1>
                <p>Start writing your amazing stories today!</p>
            </div>
        </Layout>
    );
};

export default Home;
